CREATE TABLE m_skill(
  id INTEGER NOT NULL,
  evaluation_param INTEGER NOT NULL,
  skill_target_master_id1 INTEGER NOT NULL,
  skill_target_master_id2 INTEGER,
  skill_effect_master_id1 INTEGER NOT NULL,
  skill_effect_master_id2 INTEGER,
  PRIMARY KEY (id),
  FOREIGN KEY (skill_target_master_id1) REFERENCES m_skill_target(id),
  FOREIGN KEY (skill_target_master_id2) REFERENCES m_skill_target(id),
  FOREIGN KEY (skill_effect_master_id1) REFERENCES m_skill_effect(id),
  FOREIGN KEY (skill_effect_master_id2) REFERENCES m_skill_effect(id)
);
